private SpatialArgs q(Point pt, double dist, double distPrec) {
  Shape shape = ctx.makeCircle(pt,dist);
  SpatialArgs args = new SpatialArgs(SpatialOperation.Intersects,shape);
  args.setDistPrecision(distPrec);
  return args;
}

